searchNodes=[{"doc":"BlitzLol keeps the contexts that define your domain and business logic. Contexts are also responsible for managing your data, regardless if it comes from the database, an external API or others.","ref":"BlitzLol.html","title":"BlitzLol","type":"module"},{"doc":"Client for making requests against the Riot API","ref":"BlitzLol.RiotClient.html","title":"BlitzLol.RiotClient","type":"module"},{"doc":"Fetches a match from the Riot API Example request: fetch_match ( &quot;americas&quot; , &quot;NA1_4095008822&quot; ) Example response: { :ok , %{ &quot;info&quot; =&gt; %{ &quot;participants&quot; =&gt; [ %{ ... } ] } , &quot;metadata&quot; =&gt; %{ } } }","ref":"BlitzLol.RiotClient.html#fetch_match/2","title":"BlitzLol.RiotClient.fetch_match/2","type":"function"},{"doc":"Fetches a list of matches for a given summoner puuid that matches all other criteria passed in through params Example request: fetch_matches ( &quot;americas&quot; , &quot;abc123&quot; , %{ start : 0 , count : 5 } ) Example response: { :ok , [ &quot;NA1_4095008822&quot; , &quot;NA1_4095014149&quot; , &quot;NA1_4094938474&quot; , &quot;NA1_4094905932&quot; , &quot;NA1_4094903353&quot; ] }","ref":"BlitzLol.RiotClient.html#fetch_matches/3","title":"BlitzLol.RiotClient.fetch_matches/3","type":"function"},{"doc":"Fetches a summoner from the Riot API Example request: fetch_summoner ( &quot;na1&quot; , &quot;mills&quot; ) Example response: { :ok , %{ &quot;accountId&quot; =&gt; &quot;uiEWb5xUaBh6JrbLgc7DBM05MnKG6VXX2lDjicVlU10lGg&quot; , &quot;id&quot; =&gt; &quot;uG3RHUMvuUPzq7fuJF8IdslZt8gzxslNxwgX91GdLUHLtxk&quot; , &quot;name&quot; =&gt; &quot;Mills&quot; , &quot;profileIconId&quot; =&gt; 940 , &quot;puuid&quot; =&gt; &quot;WcHwXcrQJbyqgnsXGcYlvTrEPhAcB2e11pofFCioEcKEwEkRMaMD9qrYIkzz5-MVx4q6tZZsjBIBxA&quot; , &quot;revisionDate&quot; =&gt; 1_636_252_885_672 , &quot;summonerLevel&quot; =&gt; 245 } }","ref":"BlitzLol.RiotClient.html#fetch_summoner/2","title":"BlitzLol.RiotClient.fetch_summoner/2","type":"function"},{"doc":"A region defined by the Riot API. Can be one of br1 , eun1 , euw1 , jp1 , kr , la1 , la2 , na1 , oc1 , ru , tr1","ref":"BlitzLol.RiotClient.html#t:region_type/0","title":"BlitzLol.RiotClient.region_type/0","type":"type"},{"doc":"A routing value defined by the Riot API. Can be one of americas , asia , or europe","ref":"BlitzLol.RiotClient.html#t:routing_value_type/0","title":"BlitzLol.RiotClient.routing_value_type/0","type":"type"},{"doc":"Context module for interacting with summoners","ref":"BlitzLol.Summoners.html","title":"BlitzLol.Summoners","type":"module"},{"doc":"Returns a list of summoners that a summoner has played within their last 5 matches. The summoners will then be monitored for the next hour, and will check for a newly completed match every minute. If a new match is detected, then the summoner will be logged out along with the match they completed. Example request: track_recent_summoners_by_summoner_name ( &quot;na1&quot; , &quot;mills&quot; ) Example response: { :ok , [ &quot;Tom The Killer&quot; , &quot;Jeam kai&quot; , &quot;styrofoamcond0m&quot; , &quot;ZubatUsedLowKick&quot; , &quot;Krhaal&quot; , &quot;Snytz&quot; , &quot;Kamstuh&quot; , &quot;Nef&quot; , &quot;Rogue Armadillo&quot; , &quot;greNinjaSquid&quot; , &quot;esterxk&quot; , &quot;the derpy guy&quot; , &quot;tamish3&quot; , &quot;BigSid14&quot; , &quot;Eurynnome&quot; , &quot;Madarame Ikkaku&quot; , &quot;Foxiest Boxes&quot; , &quot;ThyneBowlCut&quot; , &quot;LOAFman2020&quot; , &quot;EXP3RIENCE&quot; , &quot;Lóng gone&quot; , &quot;JoshMcDooDoo&quot; , &quot;Slain&quot; , &quot;Flzcko&quot; , &quot;1HPNotEvenClose&quot; , &quot;Picheese&quot; , &quot;nex991&quot; , &quot;HerbalHelper25&quot; , &quot;Kosher Dubstep&quot; , &quot;StanislawLeafrak&quot; , &quot;EmErEldSquEd&quot; , &quot;TheFilipinosMom&quot; , &quot;Andpv&quot; , &quot;SauceZzz&quot; , &quot;Chef Pasquale&quot; , &quot;NO69U&quot; , &quot;ExpIosìon&quot; , &quot;Raghadast&quot; , &quot;Gugulaka&quot; , &quot;PANDAMAN3659&quot; , &quot;Deleted282&quot; ] }","ref":"BlitzLol.Summoners.html#track_recent_summoners_by_summoner_name/2","title":"BlitzLol.Summoners.track_recent_summoners_by_summoner_name/2","type":"function"},{"doc":"A region defined by the Riot API. Can be one of br1 , eun1 , euw1 , jp1 , kr , la1 , la2 , na1 , oc1 , ru , tr1","ref":"BlitzLol.Summoners.html#t:region_type/0","title":"BlitzLol.Summoners.region_type/0","type":"type"},{"doc":"Helper functions for regions and routing keys","ref":"BlitzLol.Summoners.Region.html","title":"BlitzLol.Summoners.Region","type":"module"},{"doc":"Returns the correct routing_key for the provided region","ref":"BlitzLol.Summoners.Region.html#get_routing_key_for_region/1","title":"BlitzLol.Summoners.Region.get_routing_key_for_region/1","type":"function"},{"doc":"Validates the provided region. Returns on :ok tuple if valid, and an :error tuple if invalid","ref":"BlitzLol.Summoners.Region.html#validate_region/1","title":"BlitzLol.Summoners.Region.validate_region/1","type":"function"},{"doc":"About BlitzLoL","ref":"about.html","title":"About BlitzLoL","type":"extras"},{"doc":"Create a mix project application that: Given a valid summoner_name and region will fetch all summoners this summoner has played with in the last 5 matches. This data is returned to the caller as a list of summoner names (see below). Also, the following occurs: Once fetched, all summoners will be monitored for new matches every minute for the next hour When a summoner plays a new match, the match id is logged to the console, such as: Summoner &lt;summoner name&gt; completed match &lt;match id&gt; The returned data should be formatted as: [summoner_name_1, summoner_name_2, ...]","ref":"about.html#prompt","title":"About BlitzLoL - Prompt","type":"extras"},{"doc":"Install dependencies ( mix deps.get ) Create a .env file ( touch .env ) Generate a valid Riot API Key here In your .env , add your Riot API key like so: export RIOT_API_KEY = &lt; api - key &gt; Source your .env ( source .env ) Start a new iex console ( iex -S mix ) Run the following command with whatever summoner name and region you want: BlitzLol.Summoners.track_recent_summoners_by_summoner_name(&quot;na1&quot;, &quot;mills&quot;) A list of summoners will be returned, and as new matches are completed by those summoners, they will be logged to the console. There is an example output in the image below","ref":"about.html#setting-up-the-project","title":"About BlitzLoL - Setting up the project","type":"extras"},{"doc":"Below are the main modules used for this project. Docs can be viewed for each by clicking on the name of the module. BlitzLol.Summoners BlitzLol.RiotClient BlitzLol.Summoners.Region","ref":"about.html#main-modules","title":"About BlitzLoL - Main modules","type":"extras"},{"doc":"Tests can be found in the test directory of the project. API responses were mocked using the mockery library to avoid making network requests in tests.","ref":"about.html#tests","title":"About BlitzLoL - Tests","type":"extras"},{"doc":"BlitzLol Checkout the hexdocs here for more information about this project","ref":"readme.html","title":"BlitzLol","type":"extras"}]